import React from 'react';
import './Gallery.css';

const Gallery = () => {
  const images = [
    { src: '/img/', alt: 'Sembrado Ecológico 1' },
    { src: '/images/sembrado2.jpg', alt: 'Sembrado Ecológico 2' },
    { src: '/images/sembrado3.jpg', alt: 'Sembrado Ecológico 3' },
    { src: '/images/sembrado4.jpg', alt: 'Riego Automático' },
    { src: '/images/sembrado5.jpg', alt: 'Procesamiento de Residuos Biológicos' },
    { src: '/images/sembrado6.jpg', alt: 'Cuidado del Medio Ambiente' },
  ];

  return (
    <div className="gallery-container">
      <h1 className="gallery-title">Galería de Imágenes</h1>
      <p className="gallery-description">
        Explora nuestras prácticas ecológicas y tecnología innovadora en el sector agropecuario.
      </p>
      <div className="gallery-grid">
        {images.map((image, index) => (
          <div className="gallery-item" key={index}>
            <img src={image.src} alt={image.alt} className="gallery-image" />
          </div>
        ))}
      </div>
    </div>
  );
};

export default Gallery;
